import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import CreateToken from './components/CreateToken';
import MintToken from './components/MintToken';
import TransferToken from './components/TransferToken';
import BurnToken from './components/BurnToken';
import DelegateToken from './components/DelegateToken';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/create">Create Token</Link></li>
            <li><Link to="/mint">Mint Token</Link></li>
            <li><Link to="/transfer">Transfer Token</Link></li>
            <li><Link to="/burn">Burn Token</Link></li>
            <li><Link to="/delegate">Delegate Token</Link></li>
          </ul>
        </nav>
        <Switch>
          <Route path="/create" component={CreateToken} />
          <Route path="/mint" component={MintToken} />
          <Route path="/transfer" component={TransferToken} />
          <Route path="/burn" component={BurnToken} />
          <Route path="/delegate" component={DelegateToken} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
